def countTriplets(arr, r):
  count = 0
  val_counts = {}
  for i in range(2):
    if arr[i] in val_counts:
      val_counts[arr[i]] += 1
    else:
      val_counts[arr[i]] = 1

  for i in range(2, len(arr)):
    if arr[i] / r / r in val_counts and arr[i] / r in val_counts:
      count += val_counts[arr[i] / r / r] * val_counts[arr[i] / r]
    if arr[i] in val_counts:
      val_counts[arr[i]] += 1
    else:
      val_counts[arr[i]] = 1

  return count


